        <script type="text/javascript">
            jQuery(function ($) {
                jQuery('.npclosebtn').on('click', function (event) {
                    sessionStorage.setItem("notification", "disappear");
                    $('.notification_panel').fadeOut("slow");
                });
                var notification = sessionStorage.getItem("notification");
                if (notification == 'disappear') {
                    $('.notification_panel').fadeOut("slow");
                    window.scrollTo({ top: 0, behavior: 'smooth' });
                } else {
                    sessionStorage.removeItem("notification");
                    $('.notification_panel').fadeIn("slow");
                    window.scrollTo({ top: 0, behavior: 'smooth' });
                }
            });
        </script>
        <script type="text/javascript">
